"use strict";(self.webpackChunkvuepress_notes=self.webpackChunkvuepress_notes||[]).push([[3723],{628:(e,o)=>{o.A=(e,o)=>{const a=e.__vccOpts||e;for(const[e,n]of o)a[e]=n;return a}},8388:(e,o,a)=>{a.r(o),a.d(o,{comp:()=>r,data:()=>i});var n=a(8178);const t={},r=(0,a(628).A)(t,[["render",function(e,o){return(0,n.uX)(),(0,n.CE)("div",null,o[0]||(o[0]=[(0,n.Fv)('<h1 id="软件-同步-freefilesync" tabindex="-1"><a class="header-anchor" href="#软件-同步-freefilesync"><span>软件-同步-FreeFileSync</span></a></h1><h2 id="下载与安装" tabindex="-1"><a class="header-anchor" href="#下载与安装"><span>下载与安装</span></a></h2><p>下载地址：<a href="https://freefilesync.org/download.phps" target="_blank" rel="noopener noreferrer">https://freefilesync.org/download.phps</a></p><p>Linux 端安装：官方地址下载压缩包，解压得到安装脚本，运行安装脚本，跟着提示安装</p><h2 id="界面介绍" tabindex="-1"><a class="header-anchor" href="#界面介绍"><span>界面介绍</span></a></h2><h3 id="比较与同步界面" tabindex="-1"><a class="header-anchor" href="#比较与同步界面"><span>比较与同步界面</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030190430.png" alt="20231030190430" width="500"><h3 id="状态栏界面" tabindex="-1"><a class="header-anchor" href="#状态栏界面"><span>状态栏界面</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030192745.png" alt="20231030192745" width="500"><h3 id="配置界面" tabindex="-1"><a class="header-anchor" href="#配置界面"><span>配置界面</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030202645.png" alt="20231030202645" width="250"><h2 id="路径配置" tabindex="-1"><a class="header-anchor" href="#路径配置"><span>路径配置</span></a></h2><h3 id="基本路径配置" tabindex="-1"><a class="header-anchor" href="#基本路径配置"><span>基本路径配置</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030183712.png" alt="20231030183712" width="600"><h3 id="多路径配置" tabindex="-1"><a class="header-anchor" href="#多路径配置"><span>多路径配置</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030184623.png" alt="20231030184623" width="600"><p>同一行，路径是一个同步对；不同行路径不能进行同步</p><h2 id="双向差异处理" tabindex="-1"><a class="header-anchor" href="#双向差异处理"><span>双向差异处理</span></a></h2><details><summary>名词说明</summary><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030182328.png" alt="20231030182328" width="600"><p>我们将<strong>路径1</strong>的文件夹称为<strong>左侧</strong>，<strong>路径2</strong>的文件夹称为<strong>右侧</strong>（用于更好说明区分）</p></details><h3 id="差异面板图介绍" tabindex="-1"><a class="header-anchor" href="#差异面板图介绍"><span>差异面板图介绍</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030185737.png" alt="20231030185737" width="600"><ul><li>比较结果类型：说明比较以后，两侧文件的差异结果类型</li><li>比较结果差异动作：说明比较差异后，需要执行的文件动作，即 <code>删除</code>、<code>更新</code>、<code>复制</code>、<code>冲突</code>、<code>不执行</code></li></ul><p><strong>补充</strong>：将鼠标移到差异动作可以选择其他动作进行执行</p><p><strong>双向差异的多种情况</strong>：</p><ol><li>左侧增加文件 or 右侧增加文件</li><li>左侧修改文件 or 右侧修改文件</li><li>左侧删除文件 or 右侧删除文件</li><li>左右侧对同一文件进行不同修改</li></ol><h3 id="情况-1-左侧增加文件-or-右侧增加文件" tabindex="-1"><a class="header-anchor" href="#情况-1-左侧增加文件-or-右侧增加文件"><span>情况 1：左侧增加文件 or 右侧增加文件</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030190112.png" alt="20231030190112" width="600"><p>对于新增加的文件，同步动作一般为<strong>复制</strong>到未新增的路径上</p><h3 id="情况-2-左侧修改文件-or-右侧修改文件" tabindex="-1"><a class="header-anchor" href="#情况-2-左侧修改文件-or-右侧修改文件"><span>情况 2：左侧修改文件 or 右侧修改文件</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030190817.png" alt="20231030190817" width="600"><p>对于修改的文件，同步动作一般为<strong>更新</strong>另一路径下的文件</p><h3 id="情况-3-左侧删除文件-or-右侧删除文件" tabindex="-1"><a class="header-anchor" href="#情况-3-左侧删除文件-or-右侧删除文件"><span>情况 3：左侧删除文件 or 右侧删除文件</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030191030.png" alt="20231030191030" width="600"><p>对于删除的文件，同步动作一般为<strong>删除</strong>另一路径下的文件</p><h3 id="情况-4-左右侧对同一文件进行不同修改" tabindex="-1"><a class="header-anchor" href="#情况-4-左右侧对同一文件进行不同修改"><span>情况 4：左右侧对同一文件进行不同修改</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030191545.png" alt="20231030191545" width="300"><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030191215.png" alt="20231030191215" width="600"><p>对于两侧修改同一文件的行为，同步动作一般为冲突，这种情况下，根据自己的选择来进行 <code>更新左侧</code>、<code>不执行</code>、<code>更新右侧</code></p><h3 id="干预同步动作" tabindex="-1"><a class="header-anchor" href="#干预同步动作"><span>干预同步动作</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030191959.png" alt="20231030191959" width="700"><p>说明：将鼠标放到同步动作上，往左一点会出现另一个同步动作，往右一点会出现另一个同步动作，放在中间出现不执行同步动作，这样就进行动作的相应干预，可以针对任何同步动作</p><h2 id="同步的模式" tabindex="-1"><a class="header-anchor" href="#同步的模式"><span>同步的模式</span></a></h2><ol><li>双向同步：严格意义上的同步，最新修改文件覆盖原文件</li><li>镜像同步：右侧的文件完全与左侧保持一致，右侧的文件变化不影响左侧文件</li><li>增量同步：左侧新增和已更新文件会复制到右侧，左侧删除文件不会影响右侧，右侧的文件变化不影响左侧</li><li>自定义同步</li></ol><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030193513.png" alt="20231030193513" width="500"><h3 id="删除与覆盖的选择" tabindex="-1"><a class="header-anchor" href="#删除与覆盖的选择"><span>删除与覆盖的选择</span></a></h3><p>对于删除与覆盖，可以选择放到回收站（推荐）、永久删除/覆盖、历史版本（推荐）</p><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030204009.png" alt="20231030204009"><h2 id="过滤器" tabindex="-1"><a class="header-anchor" href="#过滤器"><span>过滤器</span></a></h2><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030200700.png" alt="20231030200700" width="300"><h3 id="包括内容" tabindex="-1"><a class="header-anchor" href="#包括内容"><span>包括内容</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030200911.png" alt="20231030200911" width="300"><p>包括部分使用<a href="https://freefilesync.org/manual.php?topic=exclude-files" target="_blank" rel="noopener noreferrer">通配符</a>，可添加需要同步的文件</p><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030201827.png" alt="20231030201827" width="500"><h3 id="排除内容" tabindex="-1"><a class="header-anchor" href="#排除内容"><span>排除内容</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030201416.png" alt="20231030201416" width="400"><p>排除部分参考<a href="https://freefilesync.org/manual.php?topic=exclude-files" target="_blank" rel="noopener noreferrer">示例</a>，可进行排除哪些文件夹和哪些文件进行同步</p><h2 id="配置" tabindex="-1"><a class="header-anchor" href="#配置"><span>配置</span></a></h2><h3 id="配置的保存" tabindex="-1"><a class="header-anchor" href="#配置的保存"><span>配置的保存</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030202846.png" alt="20231030202846" width="600"><h3 id="配置的切换" tabindex="-1"><a class="header-anchor" href="#配置的切换"><span>配置的切换</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030202928.png" alt="20231030202928" width="300"><h3 id="批量处理" tabindex="-1"><a class="header-anchor" href="#批量处理"><span>批量处理</span></a></h3><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030203024.png" alt="20231030203024" width="500"><p>保存为一个脚本文件，点击可以进行批量处理，可用于定时的批量处理</p><h3 id="定时处理" tabindex="-1"><a class="header-anchor" href="#定时处理"><span>定时处理</span></a></h3><p>使用RealTimeSync进行定时批量处理：</p><img src="https://raw.githubusercontent.com/Soooooox/Image-Hosting-Service/main/20231030203624.png" alt="20231030203624" width="400"><p>说明：下载完FreeFileSync会有FreeFileSync（绿色）、RealTimeSync（红色）两个软件</p><h2 id="参考" tabindex="-1"><a class="header-anchor" href="#参考"><span>参考</span></a></h2><ul><li>整体： <ul><li><a href="https://www.bilibili.com/video/BV18f4y1t7jS" target="_blank" rel="noopener noreferrer">【14001】FreeFileSync</a></li></ul></li></ul>',70)]))}]]),i=JSON.parse('{"path":"/SecondBrain/100-%E6%89%8B%E5%86%8C/103-%E8%BD%AF%E4%BB%B6%E4%BD%BF%E7%94%A8%E6%89%8B%E5%86%8C/%E8%BD%AF%E4%BB%B6-%E5%90%8C%E6%AD%A5-FreeFileSync.html","title":"软件-同步-FreeFileSync","lang":"zh-CN","frontmatter":{"description":"软件-同步-FreeFileSync 下载与安装 下载地址：https://freefilesync.org/download.phps Linux 端安装：官方地址下载压缩包，解压得到安装脚本，运行安装脚本，跟着提示安装 界面介绍 比较与同步界面 20231030190430 状态栏界面 20231030192745 配置界面 20231030202...","head":[["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"软件-同步-FreeFileSync\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Soooooox\\",\\"url\\":\\"https://github.com/Soooooox\\"}]}"],["meta",{"property":"og:url","content":"https://soooooox.github.io/Vuepress-Notes/Vuepress-Notes/SecondBrain/100-%E6%89%8B%E5%86%8C/103-%E8%BD%AF%E4%BB%B6%E4%BD%BF%E7%94%A8%E6%89%8B%E5%86%8C/%E8%BD%AF%E4%BB%B6-%E5%90%8C%E6%AD%A5-FreeFileSync.html"}],["meta",{"property":"og:site_name","content":"Soooooox 的小屋"}],["meta",{"property":"og:title","content":"软件-同步-FreeFileSync"}],["meta",{"property":"og:description","content":"软件-同步-FreeFileSync 下载与安装 下载地址：https://freefilesync.org/download.phps Linux 端安装：官方地址下载压缩包，解压得到安装脚本，运行安装脚本，跟着提示安装 界面介绍 比较与同步界面 20231030190430 状态栏界面 20231030192745 配置界面 20231030202..."}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}]]},"git":{},"readingTime":{"minutes":3.69,"words":1108},"filePathRelative":"SecondBrain/100-手册/103-软件使用手册/软件-同步-FreeFileSync.md","autoDesc":true}')}}]);